import '../../css/AddLeague/leagueForm.css'
import '../../css/Shared/button.css'
import '../../css/Shared/errorBox.css'

const LeagueForm = () => {
    return (
        <div id = "LeagueForm">
            <h1>Social Hub</h1>
            <h2>Create a League</h2>
            <Line/>

        </div>
        );
}

export default LeagueForm;
